        width={840}
        height={560}
        // playing={ isPlaying }
      />
    </section>
    <section className={azDemoVideo}>
      <ReactPlayer 
        url="https://youtu.be/bYmoMhTtZMU"
        controls
        // src={ProductDemo}
        layout="intrinsic"
        width={640}
        height={360}
      />
    </section>
  </div>
);

export default azDemo
